// src/components/EventCoordination.js
import React from 'react';
import './EventCoordination.css';

const EventCoordination = () => {
    return (
        <div className="service-page">
            <h1>Event Coordination</h1>
            <p>
                Let WedSymphony handle every detail of your event. Our expert coordinators will work with you to ensure that everything flows perfectly, from the rehearsal to the last dance. We ensure the smooth operation of your event so you can enjoy every moment without worry.
            </p>
            <p>
                Services include:
                <ul>
                    <li>Event Day Timeline Creation</li>
                    <li>On-Site Event Management</li>
                    <li>Guest Management and Seating Coordination</li>
                    <li>Vendor Liaison and Management</li>
                    <li>Logistics and Transport Coordination</li>
                </ul>
            </p>
            <p>
                Our team will ensure that your wedding day is executed flawlessly, allowing you to be fully present and enjoy every special moment.
            </p>
        </div>
    );
}

export default EventCoordination;
